def sendData(data,columns,databaseName,collectionName):
    try:
        log.info(f'Collected {len(data)} records!')
        print(f'Sending {len(data)} records to url collection.')
        df=pd.DataFrame(data,columns=columns)
        mongo_insert_data=df.to_dict('records')
        log.info('Sending Data to MongoDB!')
        def get_database():
            CONNECTION_STRING = CONNECTION_STRING_MONGODB
            client = MongoClient(CONNECTION_STRING)
            return client[databaseName]
        dbname = get_database()
        collection_name = dbname[collectionName]
        for index,instance in enumerate(mongo_insert_data):
            collection_name.update_one({'propertyId':instance['propertyId']},{'$set':instance},upsert=True)
        log.info('Data sent to MongoDB successfully')
    except Exception as e:
        log.info('Some error occured while sending data MongoDB! Following is the error.')
        log.error(e)

def removeDuplicates(lst):
    returnList=[]
    for instance in lst:
        if instance not in returnList:
            returnList.append(instance)
    return returnList

links=[]
columns=['url','propertyId','newEntry','city','price','discountedPrice','currency','pricingCriteria','isSuperhost']
databaseName='airbnb'
collectionName='propertyURLs'

def start_chrome_tab():
    chromeOptions = webdriver.ChromeOptions()
    chromeOptions.add_argument("--disable-popup-blocking")
    chromeOptions.add_argument("--headless")  # Run Chrome in headless mode
    chromeOptions.add_argument("--window-size=1920,1080")

    driver = webdriver.Chrome(options=chromeOptions)
    try:
        driver.minimize_window()
    except:
        pass
    try:
        driver.maximize_window()
    except:
        pass
    log.info("Successfully started chrome tab.")
    return driver

driver = start_chrome_tab()

for url in allURL:
    try:
        singlePage=False
        driver.get(url)
        driver.implicitly_wait(30)
        try:
            element = WebDriverWait(driver, 20).until(
            EC.presence_of_element_located((By.XPATH,'//nav[@aria-label="Search results pagination"]//a[last()-1]')))
        except TimeoutException:
            pass    
        try:
            totalPages=int(driver.execute_script('''
            return document.evaluate('//nav[@aria-label="Search results pagination"]//a[last()-1]', 
                                document, null, XPathResult.FIRST_ORDERED_NODE_TYPE, null).singleNodeValue.textContent
            '''))
        except:
            totalPages=2
            singlePage=True

        for page in range(1,totalPages):
            driver.execute_script('''
                window.location.reload(true)
            ''')
            data=driver.execute_script('''
                return JSON.parse(document.getElementById("data-deferred-state-0").textContent)
                .niobeMinimalClientData[0][1].data.presentation.staysSearch.results
                .searchResults;
            ''')
            for instance in data:
                if instance['__typename']!="StaySearchResult":
                    continue
                if instance["avgRatingLocalized"]!=None and instance["avgRatingLocalized"].strip()=='New':
                    newEntry=True
                else:
                    newEntry=False

                isSuperhost=False
                try:
                    if (instance["badges"][0]['text'].strip()=='Superhost'):
                        isSuperhost=True
                except IndexError:
                    pass
                
                city=None
                propertyId=instance["listing"]["id"]
                url="https://www.airbnb.com/rooms/"+propertyId.strip()

                if 'originally' in instance["pricingQuote"]["structuredStayDisplayPrice"]["primaryLine"]["accessibilityLabel"]:
                    pricestr=instance["pricingQuote"]["structuredStayDisplayPrice"]["primaryLine"]["discountedPrice"]
                    discountedPrice=instance["pricingQuote"]["structuredStayDisplayPrice"]["primaryLine"]["originalPrice"]
                else:
                    pricestr= instance["pricingQuote"]["structuredStayDisplayPrice"]["primaryLine"]["price"]
                    discountedPrice=None
                price=float(re.findall('[0-9]+', pricestr)[0])
                currency=re.findall('[^0-9]+', pricestr)[0]
                pricingCriteria=instance["pricingQuote"]["structuredStayDisplayPrice"]["primaryLine"]["qualifier"]

                links.append([url,propertyId,newEntry,city,price,discountedPrice,currency,pricingCriteria,isSuperhost])
                print(url)
            try:
                element = WebDriverWait(driver, 20).until(
                EC.presence_of_element_located((By.XPATH,'//a[@aria-label="Next"]')))
            except TimeoutException:
                pass
            if singlePage==False:
                driver.execute_script('''
                document.evaluate('//a[@aria-label="Next"]', 
                                    document, null, XPathResult.FIRST_ORDERED_NODE_TYPE, null).singleNodeValue.click()
                ''')
            time.sleep(2)
    
    except Exception as e:
        log.info("Error occured at URL: ",url)
        log.error(e)
        log.info("Restarting the Chrome tab!")
        driver.quit()
        driver = start_chrome_tab()
    
    finally:
        links=removeDuplicates(links)     
        sendData(links,columns,databaseName,collectionName) 
